"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[4293],{1906:e=>{e.exports=JSON.parse('{"label":"react","permalink":"/tags/react","allTagsPath":"/tags","count":11,"items":[{"id":"frontend/react-next/components-map","title":"Components Map","description":"\u5728 React \u4e2d\u4f7f\u7528 components map \u53ef\u4ee5\u66f4\u7cbe\u7c21\u5730\u4f7f\u7528\u689d\u4ef6\u5f0f\u6e32\u67d3\u5143\u4ef6\u3002\u6211\u5011\u53ef\u4ee5\u4f7f\u7528\u666e\u901a\u7684 JavaScript \u7269\u4ef6\u6216 Map \u5275\u5efa components map\uff0c\u4ee5\u53ca\u4f7f\u7528 lazy-loading \u4f7f\u5143\u4ef6\u52d5\u614b\u8f09\u5165\u3002\u53e6\u5916\uff0c\u5728\u5207\u63db\u5143\u4ef6\u6642\u4f7f\u7528 startTransition \u53ef\u4ee5\u907f\u514d\u5143\u4ef6\u5207\u63db\u9583\u720d\u7684\u554f\u984c\u3002\u6700\u5f8c\uff0c\u4f7f\u7528 components map \u6709\u4e00\u500b\u7f3a\u9ede\uff0c\u5c31\u662f map \u4e2d\u7684\u6240\u6709\u5143\u4ef6\u5fc5\u9808\u4f7f\u7528\u76f8\u540c\u7684 props\u3002","permalink":"/frontend/react-next/components-map"},{"id":"frontend/react-next/function-composition","title":"Function Composition","description":"\u672c\u6587\u4ecb\u7d39\u4e86\u5982\u4f55\u4f7f\u7528 Function Composition \u4f86\u5c07 React \u5c08\u6848\u4e2d\u7684 cross-cutting concerns \u7d44\u5408\u6210\u4e00\u500b HOC\uff0c\u4e26\u4e14\u4f7f\u7528 currying \u4f86\u89e3\u6c7a HOC \u9700\u8981\u6709\u689d\u4ef6\u7684\u6e32\u67d3\u7684\u554f\u984c\u3002\u4f5c\u8005\u63d0\u51fa\u7684\u89e3\u6c7a\u65b9\u6848\u662f\u5c07\u9019\u4e9b\u91cd\u8907\u7684\u5340\u584a cross-cutting concerns \u900f\u904e function composition \u628a\u591a\u500b HOC \u7d44\u5408\u6210\u4e00\u500b\u5927\u7684 HOC\uff0c\u7136\u5f8c\u5728\u5c08\u6848\u4e2d\u4f7f\u7528\u5b83\uff0c\u4ee5\u6e1b\u5c11\u91cd\u8907\u7684\u5de5\u4f5c\u3002","permalink":"/frontend/react-next/function-composition"},{"id":"frontend/react-next/is-usestate-asynchronous","title":"Is useState Asynchronous","description":"\u9019\u7bc7\u6587\u7ae0\u6df1\u5165\u63a2\u8a0e\u4e86 useState \u7684\u540c\u6b65\u7279\u6027\u4ee5\u53ca\u932f\u8aa4\u4f7f\u7528\u65b9\u5f0f\u3002\u7279\u5225\u662f\u5728\u4f7f\u7528 setter \u548c getter \u540c\u6642\u7684\u60c5\u6cc1\u4e0b\uff0c\u5bb9\u6613\u51fa\u73fe\u7684\u932f\u8aa4\uff0c\u6211\u5011\u5c07\u900f\u904e\u5177\u9ad4\u7684\u7bc4\u4f8b\uff0c\u5e6b\u52a9\u7406\u89e3\u932f\u8aa4\u7684\u539f\u56e0\u548c\u89e3\u6c7a\u65b9\u6848\u3002","permalink":"/frontend/react-next/is-usestate-asynchronous"},{"id":"frontend/react-next/keeping-state-local","title":"Keeping State Local","description":"\u5728 React \u7684\u72c0\u614b\u7ba1\u7406\u4e2d\uff0c\u6709\u4e00\u500b\u9ec3\u91d1\u898f\u5247\uff0c\u5c31\u662f\u76e1\u53ef\u80fd\u5730\u5c07\u72c0\u614b\u4fdd\u6301\u5728\u5143\u4ef6\u672c\u8eab\u3002\u9019\u610f\u5473\u8457\u4f60\u61c9\u8a72\u53ea\u5728\u9700\u8981\u5b83\u7684\u5143\u4ef6\u4e2d\u5ba3\u544a\u72c0\u614b\uff0c\u800c\u4e0d\u662f\u6bcf\u6b21\u90fd\u5c07\u72c0\u614b\u5ba3\u544a\u5728\u6700\u4e0a\u5c64\u7684\u5143\u4ef6\u4e2d\u3002\u5728\u6700\u4e0a\u5c64\u5ba3\u544a\u72c0\u614b\uff0c\u53ef\u80fd\u6703\u5c0e\u81f4\u4e0d\u5fc5\u8981\u7684\u8907\u96dc\u6027\uff0c\u4f7f\u4f60\u7684\u7a0b\u5f0f\u78bc\u96e3\u4ee5\u7dad\u8b77\u3002","permalink":"/frontend/react-next/keeping-state-local"},{"id":"frontend/react-next/react-folder-structure","title":"React Folder Structure","description":"React \u5c08\u6848\u7684\u7d50\u69cb\u53ef\u4ee5\u5206\u6210\u4e09\u500b\u7b49\u7d1a\uff1a\u521d\u7d1a\u3001\u4e2d\u7d1a\u548c\u9ad8\u7d1a\uff0c\u800c\u6bcf\u500b\u7b49\u7d1a\u7684\u7d50\u69cb\u5c0d\u65bc\u4e0d\u540c\u5927\u5c0f\u7684\u5c08\u6848\u90fd\u6709\u4e0d\u540c\u7684\u9069\u7528\u60c5\u6cc1\u3002\u5728\u521d\u7d1a\u7d50\u69cb\u4e2d\uff0c\u6240\u6709\u91cd\u8981\u7684\u5143\u4ef6\u3001\u9801\u9762\u3001\u7248\u9762\u90fd\u6703\u653e\u5728 `components/` \u8cc7\u6599\u593e\u4e2d\u3002\u800c\u8f03\u5927\u578b\u7684\u5c08\u6848\u5247\u53ef\u4ee5\u4f7f\u7528\u4e2d\u7d1a\u6216\u9ad8\u7d1a\u7d50\u69cb\uff0c\u5c07\u6a94\u6848\u5206\u985e\u66f4\u6e05\u6670\u3002\u5982\u679c\u4f60\u6b63\u5728\u958b\u767c React \u5c08\u6848\uff0c\u53ef\u4ee5\u53c3\u8003\u9019\u4e9b\u7d50\u69cb\u4f86\u66f4\u6709\u6548\u7387\u5730\u7d44\u7e54\u4f60\u7684\u6a94\u6848\u3002","permalink":"/frontend/react-next/react-folder-structure"},{"id":"frontend/react-next/react-scroll-animations","title":"React Scroll Animations","description":"\u6211\u5011\u53ef\u4ee5\u900f\u904e `IntersectionObserver` \u4f86\u5075\u6e2c\u5143\u7d20\u662f\u5426\u5728\u8996\u7a97\u4e2d\uff0c\u4e26\u4e14\u900f\u904e CSS transition \u4f86\u5be6\u73fe\u6efe\u52d5\u6642\u7684\u52d5\u756b\u6548\u679c\u3002\u9019\u500b\u65b9\u6cd5\u4e0d\u9700\u8981\u4efb\u4f55\u7b2c\u4e09\u65b9\u5957\u4ef6\uff0c\u800c\u4e14\u53ef\u4ee5\u88fd\u4f5c\u6210\u4e00\u500b\u901a\u7528\u7684\u52d5\u756b\u5143\u4ef6\uff0c\u8b93\u958b\u767c\u8005\u53ef\u4ee5\u81ea\u884c\u6c7a\u5b9a\u52d5\u756b\u7684\u6548\u679c\u3002","permalink":"/frontend/react-next/react-scroll-animations"},{"id":"frontend/react-next/intro","title":"README","description":"\u524d\u7aef\u6280\u8853\u767c\u5c55\u8d85\u7d1a\u5feb\u901f\uff0c\u6bcf\u5929\u90fd\u6709\u65b0\u7684\u6280\u8853\u51fa\u73fe\uff0c\u70ba\u4e86\u8ffd\u96a8\u6642\u4ee3\u7684\u8173\u6b65\uff0c\u4fdd\u6301\u8207\u6642\u4ff1\u9032\uff0c\u6240\u4ee5\u6211\u559c\u6b61\u8a02\u95b1\u4e00\u4e9b\u96fb\u5b50\u5831\uff0c\u641c\u5c0b\u6709\u8da3\u7684\u6280\u8853\u6587\u7ae0\uff0c\u4ee5\u53ca\u5728 YouTube \u4e0a\u4e82\u770b\u4e00\u4e9b\u6280\u8853\u5f71\u7247\u3002\u9019\u6a23\u6211\u5c31\u80fd\u4e0d\u65b7\u5b78\u7fd2\uff0c\u7372\u5f97\u6700\u65b0\u7684\u524d\u7aef\u6280\u8853\u8cc7\u8a0a\uff0c\u6211\u4e5f\u6703\u5c07\u6211\u6240\u5b78\u5230\u7684\u77e5\u8b58\u5206\u4eab\u7d66\u5927\u5bb6\uff0c\u5e0c\u671b\u5927\u5bb6\u4e5f\u80fd\u5f9e\u4e2d\u5b78\u7fd2\u5230\u65b0\u7684\u77e5\u8b58\uff0c\u4e26\u4e14\u4e00\u8d77\u6df1\u5165\u63a2\u8a0e\uff0c\u52a0\u6df1\u5c0d\u524d\u7aef\u6280\u8853\u7684\u7406\u89e3\u3002","permalink":"/frontend/react-next/intro"},{"id":"frontend/react-next/state-in-urlsearchparams","title":"State in URLSearchParams","description":"\u672c\u7bc7\u6587\u7ae0\u4ecb\u7d39\u4e86\u5728 React \u4e2d\u5982\u4f55\u4f7f\u7528 URLSearchParams \u5132\u5b58\u72c0\u614b\uff0c\u4ee5\u53ca\u5982\u4f55\u4f7f\u7528 React Router \u63d0\u4f9b\u7684 useSearchParams \u548c useLocation \u4f86\u7ba1\u7406\u548c\u5206\u4eab\u72c0\u614b\u3002\u9084\u5c01\u88dd\u4e86\u4e00\u500b useSearchParamsState\uff0c\u63d0\u4f9b\u4e86\u985e\u4f3c useState \u7684 API\u3002","permalink":"/frontend/react-next/state-in-urlsearchparams"},{"id":"frontend/other/subpath-imports-in-rollup","title":"Subpath Imports in Rollup","description":"\u9019\u7bc7\u6587\u7ae0\u4e3b\u8981\u4ecb\u7d39\u4e86\u5982\u4f55\u4f7f\u7528 subpath imports \u5be6\u73fe\u55ae\u7368\u5c0e\u5165\u5143\u4ef6\u7684\u529f\u80fd\uff0c\u55ae\u7368\u4f7f\u7528\u6bcf\u500b\u5143\u4ef6\u7684\u6642\u5019\uff0c\u4e0d\u9700\u8981\u518d\u5c0e\u5165\u6574\u500b\u5143\u4ef6\u5eab\uff0c\u512a\u5316\u5143\u4ef6\u5eab\u7684\u6548\u80fd\u3002\u95dc\u9375\u5728\u65bc\u900f\u904e rollup-plugin-generate-package-json \u7b49\u63d2\u4ef6\u548c\u51fd\u5f0f\uff0c\u5728\u8a2d\u7f6e rollup.config.js \u6642\u70ba\u6bcf\u500b\u5143\u4ef6\u55ae\u7368\u751f\u6210 index.js\u3001index.d.ts \u548c package.json \u6a94\u6848\u3002","permalink":"/frontend/other/subpath-imports-in-rollup"},{"id":"frontend/html-css/the-orton-effect","title":"The Orton Effect","description":"\u9019\u7bc7\u6587\u7ae0\u4ecb\u7d39\u4e86 Orton Effect\uff0c\u4e00\u7a2e\u651d\u5f71\u6280\u8853\uff0c\u4e26\u4e14\u4f7f\u7528 CSS \u548c React \u5be6\u73fe\u4e86\u9019\u7a2e\u6548\u679c\u3002","permalink":"/frontend/html-css/the-orton-effect"},{"id":"frontend/react-next/use-imperative-handle","title":"useImperativeHandle","description":"\u672c\u6587\u5c07\u4ecb\u7d39 useImperativeHandle \u9019\u500b hook\uff0c\u5b83\u53ef\u4ee5\u8b93\u6211\u5011\u6514\u622a\u7236\u5143\u4ef6\u50b3\u905e\u7684 ref\uff0c\u4e26\u56de\u50b3\u4e00\u7d44\u65b0\u7684\u65b9\u6cd5\u7d66\u8a72 ref\u3002 \u9019\u500b hook \u901a\u5e38\u6703\u642d\u914d forwardRef \u4e00\u8d77\u4f7f\u7528\uff0c\u8b93\u6211\u5011\u5728\u81ea\u5b9a\u7fa9\u5143\u4ef6\u4e2d\u53d6\u5f97 DOM reference\uff0c\u4e26\u4e14\u53ef\u4ee5\u5728\u7236\u5143\u4ef6\u4e2d\u4f7f\u7528\u5b50\u5143\u4ef6\u7684\u51fd\u5f0f\u3002","permalink":"/frontend/react-next/use-imperative-handle"}]}')}}]);